import React from "react";
import "./gamescorecarrousel.css";
import { useSpringCarousel } from 'react-spring-carousel';
import image1 from "../../assets/images/winningPatterns/bottomU.png";
import image2 from "../../assets/images/winningPatterns/bottomLine.png";
import image3 from "../../assets/images/winningPatterns/JackpotLine.png";
import image4 from "../../assets/images/winningPatterns/M.png";
import image5 from "../../assets/images/winningPatterns/middleLine.png";
import image6 from "../../assets/images/winningPatterns/mShapeStarttinBottomLeft.png";
import image7 from "../../assets/images/winningPatterns/topLine.png";
import image8 from "../../assets/images/winningPatterns/uShapeBottomHalf.png";
import image9 from "../../assets/images/winningPatterns/uShapeInverseTopHalf.png";
import image10 from "../../assets/images/winningPatterns/uShapeTopHalf.png";
import image11 from "../../assets/images/winningPatterns/V.png";
import image12 from "../../assets/images/winningPatterns/VupsideDown.png";
import image13 from "../../assets/images/winningPatterns/w.png";
import image14 from "../../assets/images/winningPatterns/wInverse.png";
import image15 from "../../assets/images/winningPatterns/wShapeOnBottomHalf.png";
import image16 from "../../assets/images/winningPatterns/WUpperCase.png";
import image17 from "../../assets/images/winningPatterns/Z.png";
import image18 from "../../assets/images/winningPatterns/ZInverse.png";

const GameScoreCarousels = () =>{
   
    const items =[
            {
                id: image1,
                renderItem: (
                    <div  className="item">
                    <img  src={image1} alt=""/>
                    </div>
                )
            },
            {
                id: image2,
                renderItem: (
                    <div  className="item">
                    <img  src={image2} alt=""/>
                    </div>
                )
            },
            {
                id: image3,
                renderItem: (
                    <div  className="item">
                    <img  src={image3} alt=""/>
                    </div>
                )
            },
            {
                id: image4,
                renderItem: (
                    <div  className="item">
                        <img  src={image4} alt=""/>
                    </div>
                )
            },
            {
                id: image5,
                renderItem: (
                    <div className="item">
                        <img  src={image5} alt=""/>
                    </div>
                )
            },
            {
                id: image6,
                renderItem: (
                    <div className="item">
                        <img  src={image6} alt=""/>
                    </div>
                )
            }, 
            {
                id: image7,
                renderItem: (
                    <div className="item">
                        <img  src={image7} alt=""/>
                    </div>
                )
            }, 
            {
                id: image8,
                renderItem: (
                    <div className="item">
                        <img  src={image8} alt=""/>
                    </div>
                )
            },
            {
                id: image9,
                renderItem: (
                    <div className="item">
                        <img  src={image9} alt=""/>
                    </div>
                )
            },
            {
                id: image10,
                renderItem: (
                    <div className="item">
                        <img  src={image10} alt=""/>
                    </div>
                )
            },
            {
                id: image11,
                renderItem: (
                    <div className="item">
                        <img  src={image11} alt=""/>
                    </div>
                )
            },
            {
                id: image12,
                renderItem: (
                    <div className="item">
                        <img  src={image12} alt=""/>
                    </div>
                )
            },
            {
                id: image13,
                renderItem: (
                    <div className="item">
                        <img  src={image13} alt=""/>
                    </div>
                )
            },
            {
                id: image14,
                renderItem: (
                    <div className="item">
                        <img  src={image14} alt=""/>
                    </div>
                )
            },
            {
                id: image15,
                renderItem: (
                    <div className="item">
                        <img  src={image15} alt=""/>
                    </div>
                )
            }, {
                id: image16,
                renderItem: (
                    <div className="item">
                        <img  src={image16} alt=""/>
                    </div>
                )
            }, {
                id: image17,
                renderItem: (
                    <div className="item">
                        <img  src={image17} alt=""/>
                    </div>
                )
            },
            {
                id: image18,
                renderItem: (
                    <div className="item">
                        <img  src={image18} alt=""/>
                    </div>
                )
            }
        ];

        const { 
            carouselFragment
          } = useSpringCarousel({
            itemsPerSlide: 3, 
            withLoop: true,
            items: items.map((i) => ({
              id: i.id,
              renderItem: (
                <div  className="item">
                    <img  src={i.id} alt=""/>
                </div>
              ),
            })),
          });

    return (
    <>
        <div className="winningPatterns">
            <h2 className="h2-title">Winning Patterns and Values</h2>
        </div>
        <div className="carousel">
            <div className="inner-carousel" >
                {carouselFragment}
            </div>
      </div>
    </>
        )
}

export default GameScoreCarousels;
